                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
            }
            ... on LabeledEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              label { name color }
            }
            ... on UnlabeledEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              label { name color }
            }
            ... on AssignedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              assignee { __typename ... on User { login id id } }
            }
            ... on UnassignedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              assignee { __typename ... on User { login id id } }
            }
            ... on MilestonedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              milestoneTitle
            }
            ... on DemilestonedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              milestoneTitle
            }
            ... on RenamedTitleEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              previousTitle
              currentTitle
            }
            ... on CrossReferencedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              source {
                __typename
                ... on Issue { number url title }
                ... on PullRequest { number url title }
              }
            }
            ... on ReferencedEvent {
              id
              createdAt
              actor {
                __typename
                login
                url
                avatarUrl
                ... on User { id databaseId }
                ... on Organization { id databaseId }
                ... on Bot { id databaseId }
                ... on Mannequin { id databaseId }
              }
              commit { oid url }
              commitRepository { nameWithOwner }
            }
          }
        }
      }
    }
  }
}
